function Portfolio(props) {
  return (
    <div>
      {props.sites.map(site => {
        <h1>
          <a href="http://localhost:8888/Beauty/">{site}</a>
        </h1>;
      })}
    </div>
  );
}

Portfolio.defaultProps = {
  sites: [
    "Beauty Site",
    "Cosmetics Site",
    "Restaurant Site",
    "Sports Site",
    "Music Site",
    "Legal Site"
  ]
};

export default Portfolio;
